import React, { useEffect, useState } from "react"
import { useNavigate } from 'react-router-dom'

const ListOfTopics = () => {

    const [data, setData] = useState([]);
    let dataArr;

    const getList = async () => {
        try {
            const response = await fetch("http://localhost:4000/todos");
            const jsonData = await response.json();
            setData(jsonData);

        } catch (error) {
            console.error(error);
        }
    }

    useEffect(() => {getList();});

    console.log(data);

    dataArr = Object.values(data);

    return (<form>
        <table>
            <thead>
                <tr>
                    <th>
                        Account
                    </th>
                    <th>
                        Password
                    </th>
                </tr>
            </thead>
            <tbody>
                {dataArr.map(el => (
                    <tr>
                        <td>{el.account_name}</td>
                        <td>{el.account_password}</td>
                    </tr>
                ))}
            </tbody>
        </table>
        <button onClick={()=> useNavigate("/account")}>Go to account</button>
    </form>);
};

export default ListOfTopics;
